import React, { Component } from 'react';

import SideMenu from "../components/userHome/sideMenu";
import Server from "../components/userHome/server"
import Options from "../components/userHome/options"

class UserHomePage extends Component {
    state = { 
        page: ["server"]
     }

     setState = ()=>{
        if(this.state.page.indexOf("server")){
            console.log("1",this.state.page)
            this.setState({
                page:"options"
            })
        }else{
            console.log("2", this.state.page)
            this.setState({
                page:"server"
            })
        }
     }

     getPage = ()=>{
         let component
                 switch (this.state.page){
            case "server":
                component = <Server/>
                break;
            case "options":
                component = <Options/>
                break;
            default:
                component = <Server/>
                break;
            }
            return component;
     }

    render() { 
        return ( 
            <dir className="userHomeLayout">
                <dir className="userHomesideMenu">
                    <SideMenu setState={this.setState}/>
                </dir>
                {this.getPage}
            </dir>
         );
    }
}

export default UserHomePage;
